&quot;Take the Money and Run (1969) 
This film is presented as a documentary on the life of an incompetent, petty criminal called Virgil Starkwell, played by Woody Allen. It describes the early childhood and youth of Virgil, his failure at a musical career, and his obsession with bank robberies. The film uses a voice over narrative and interviews with his family, friends and acquaintances.&quot;

